import React, { Component } from 'react';

class Dashboard extends Component {
    render() {
        return (
            <div className="flexible-content">
                <TopNavigation />
                <SideNavigation />
                <main id="content" className="p-5">
                    {/* <Routes /> */}
                </main>
                <Footer />
            </div>
        );
    }
}

export default Dashboard;
